import base64


class DataMgr(object):
  loading = ""

  loading_gif = ""

  logo_round = ""

  placeholder_avatar = ""

  files = ['loading', 'loading_gif', 'logo_round', 'placeholder_avatar']

  @classmethod
  def GetData(cls, name):
      data = getattr(cls, name)
      return base64.b64decode(data.encode('utf-8'))
